import React from 'react'
import PropTypes from 'prop-types'

const UserGoalCard = ({ goalCard }) => {
    return (
        <div>    
            <h4> 
                <strong> Actual weight: </strong> { goalCard && goalCard.actualWeight && (
                    goalCard.actualWeight
                )}
            </h4>
            <h4>
                <strong> Goal weight: </strong> { goalCard && goalCard.goalWeight && (
                    goalCard.goalWeight
                )}
            </h4>
            <h4>
                <strong> Height: </strong> {goalCard && goalCard.height && (
                    goalCard.height
                )}
            </h4>
            <h4>
                <strong> Kcal: </strong> {goalCard && goalCard.kcal && (
                    goalCard.kcal
                )}
            </h4>
            <h4>
                <strong> Trainings per week: </strong> {goalCard && goalCard.trainingRate && (
                    goalCard.trainingRate
                )}
            </h4>
        </div>

    )

}

UserGoalCard.propTypes = {
    goalCard: PropTypes.array.isRequired,
}

export default UserGoalCard
